import React from 'react'
import './ratings.css'

function Ratings(props){
    return(
        <div className="faculty-professors" style={{display: 'flex', flexDirection: 'column'}}>
            <img  className="faculty-image" src={props?.faculty?.img}/>
            <h4 className="faculty-info">{props?.faculty?.name}</h4>
        </div>
    )
}
export default Ratings
